import React from "react";
import {components} from "react";



const Login = ()=>{
    return(
        <>
        
<form>

  <div c="form-group">
    <label for="exampleInputEmail1">Email address</label>
    <input type="email" c="form-control" id="exampleInputEmail1" aria-describedby="emailHelp"/>
    <small id="emailHelp" c="form-text text-muted">We'll never share your email with anyone else.</small>
  </div>
  <div c="form-group">
    <label for="exampleInputPassword1">Password</label>
    <input type="password" c="form-control" id="exampleInputPassword1"/>
  </div>
  <div c="form-group form-check">
    <input type="checkbox" c="form-check-input" id="exampleCheck1"/>
    <label c="form-check-label" for="exampleCheck1">Check me out</label>
  </div>
  <button type="submit" c="btn btn-primary">Submit</button>

 
</form>



</>
);
    };
export default Login;
